import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="toolbar">
        <ul>
          <li>Cooper Hewitt</li>
          <li>About</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
